export default function LoginPage() {
  async function logInHandler(event) {
    event.preventDefault();
    const res = awaitSubmitHandler(inputName, inputPassword);
  }

  return (
    <div>
      <h1>login</h1>
      <Form submitHandler={logInHandler} />
    </div>
  );
}
